import logo from './logo.svg';
import './App.css';
import React from 'react'
import Box from '@mui/material/Box';
import Button from '@mui/material/Box';

function Projects(props) {
  return (
    <header> 
      <h1>Hello {props}</h1>
      <h1>Project Catalog</h1>
      <h2 className = 'customheader'>Project 1<button className = 'btn'>Add</button></h2>
      <h2 className = 'customheader'>Project 2<button className = 'btn'>Add</button></h2>
      <h2 className = 'customheader'>Project 3<button className = 'btn'>Add</button></h2>
    </header>
  )
}

class App extends React.Component {
  render(){
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <Projects name = 'User'/>
        </header>
      </div>
    );
  }
}

export default App;
